本身皮膚就不是那種白透白透粉嫩的
反而是蠟黃有時候綠綠的🤷🏻‍♀️超級無法說自己素顏美的那種🤪

 所以夏天到了也比較傾向曬黑一點（不刻意曬或遮陽）
有時候工作熬夜氣色很差
雖然粉底可以稍稍蓋住暗沈
但有時候就是沒有透亮感

 植村秀這款修飾乳讓我驚艷到！
剛上上去不會有什麼修飾的感覺，待吸收一下反而提亮膚色了

 當然這次 @makeupforevertw 粉底有稍稍遮瑕卻也很薄透
很喜歡上完後的感覺膚況超好☺️
只不過很可惜這款顏色台灣最深只有到我影片用的Y315（我之後使用都有調深一點的粉底進去）

 難得我打了心得分享😚
希望有幫助到想購入的你們
